-- ----------------------------
-- Table structure for pl_datasource
-- ----------------------------
DROP TABLE IF EXISTS `pl_datasource`;
CREATE TABLE `pl_datasource` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(100) DEFAULT NULL COMMENT '名称',
  `connection_type` int(11) DEFAULT '0' COMMENT '连接类型 0:主机连接,1:URl连接',
  `db_type` varchar(20) DEFAULT 'mysql' COMMENT '数据库类型',
  `host` varchar(30) DEFAULT NULL COMMENT '主机',
  `port` varchar(10) DEFAULT NULL COMMENT '端口',
  `instance` varchar(100) DEFAULT NULL COMMENT '实例名',
  `db_name` varchar(150) DEFAULT NULL COMMENT '数据库名称',
  `url` text COMMENT '地址',
  `username` varchar(150) DEFAULT NULL COMMENT '用户名',
  `password` varchar(255) DEFAULT NULL COMMENT '密码',
  `tenant_id` varchar(64) DEFAULT NULL COMMENT '租户id',
  `create_user_id` varchar(64) DEFAULT NULL COMMENT '创建人id',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_user_id` varchar(0) DEFAULT NULL COMMENT '更新人id',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `delete_flag` int(11) DEFAULT '0' COMMENT '逻辑删除 0:正常，1:删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='数据源';

